BEGIN
select count(act.ActivityStatusID),stat.Name from activity as act join status as stat
join businesspartner as bp join opportunity as opp 
 on act.ActivityStatusID=stat.StatusID and opp.BPID=bp.BPID and opp.OpportunityID=act.OpportunityID
 where bp.AssignedRep like leadUserId and (act.AssignedTo like actUserId or act.CreatedBy like actUserId) and bp.OrgID like orgId and bp.DeleteFlag like status and  opp.DeleteFlag like status and act.DeleteFlag like status and stat.key like activitykeys
  group by act.ActivityStatusID ;
  
END//
